source":null,"units":null,"decimals":null},"StdGeographyID":{"type":"string","alias":"Standard geography Id","vintage":null,"source":null,"units":null,"decimals":null},"StdGeographyLevel":{"type":"string","alias":"Standard geography level","vintage":null,"source":null,"units":null,"decimals":null},"ATRISKTOTPOP_CY":{"type":"number","alias":"2025 Total Population","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKAVGHHSZ_CY":{"type":"number","alias":"2025 Average Household Size","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSPOPGRWCYFY":{"type":"number","alias":"2025-2030 Growth Rate: Population","vintage":"2030","source":"Esri","units":null,"decimals":null,"definition":"The Esri 2025-2030 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSDIVINDX_CY":{"type":"number","alias":"2025 Diversity Index","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"WEALTHMEDNW_CY":{"type":"number","alias":"2025 Median Net Worth","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINC_CY":{"type":"number","alias":"2025 Median Household Income","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVAL_CY":{"type":"number","alias":"2025 Median Home Value","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"AGEBYRACEBYSEXASN0_CY":{"type":"number","alias":"2025 Asian Pop 0-4","vintage":"2025","source":"Esri","units":null,"decimals":null,"definition":"Esri 2025 estimate of t ame","calculatorName":"headers","templateName":"headers.StdGeographyName","type":"esriFieldTypeString","vintage":null,"source":null},"headers.StdGeographyID":{"id":"StdGeographyID","fullName":"StdGeographyID","fieldName":"StdGeographyID","calculatorName":"headers","templateName":"headers.StdGeographyID","type":"esriFieldTypeString","vintage":null,"source":null},"headers.StdGeographyLevel":{"id":"StdGeographyLevel","fullName":"StdGeographyLevel","fieldName":"StdGeographyLevel","calculatorName":"headers","templateName":"headers.StdGeographyLevel","type":"esriFieldTypeString","vintage":null,"source":null},"headers.AREA_DESC":{"id":"AREA_DESC","fullName":"AREA_DESC","fieldName":"AREA_DESC","calculatorName":"headers","templateName":"headers.AREA_DESC","type":"esriFieldTypeString","vintage":null,"source":null},"headers.STORE_NAME":{"id":"STORE_NAME","fullName":"STORE_NAME","fieldName":"STORE_NAME","calculatorName":"headers","templateName":"headers.STORE_NAME","type":"esriFieldTypeString","vintage":null,"source":null},"dataCollectionsCalculator.ATRISKTOTPOP_CY":{"id":"TOTPOP_CY","fullName":"AtRisk.TOTPOP_CY","alias":"2025 Total Population","fieldName":"ATRISKTOTPOP_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTPOP_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKAVGHHSZ_CY":{"id":"AVGHHSZ_CY","fullName":"AtRisk.AVGHHSZ_CY","alias":"2025 Average Household Size","fieldName":"ATRISKAVGHHSZ_CY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKAVGHHSZ_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2025-2030 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2030","source":"Esri","definition":"The Esri 2025-2030 Population Compound Annual Growth Rate (CAGR) is an annualized measure describing the direction (either positive or negative) and magnitude of change in the total number of persons between the years 2025 and 2030. Annualized means that the resultant value reflects a rate of change over a twelve-month time period. This permits analysis of multiple growth rates between values measured at differing points in time using a common time period of twelve months; the annualized growth rate is repeated, or compounded, each year. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocabulary/cagr'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY":{"id":"DIVINDX_CY","fullName":"KeyUSFacts.DIVINDX_CY","alias":"2025 Diversity Index","fieldName":"KEYUSFACTSDIVINDX_CY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSDIVINDX_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimated Diversity Index in the geographic area. Esri's Diversity Index summarizes racial and ethnic diversity, indicating the likelihood that two individuals, chosen at random from the same area, belong to the same race or ethnic group. The index ranges from 0 (no diversity) to 100 (highest diversity). An area's Diversity Index increases when the population includes more race/ethnic groups. <a target='_blank' href='https://links.esri.com/diversity-index'>read more</a> See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.WEALTHMEDNW_CY":{"id":"MEDNW_CY","fullName":"Wealth.MEDNW_CY","alias":"2025 Median Net Worth","fieldName":"WEALTHMEDNW_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.WEALTHMEDNW_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Net Worth in the geographic area. Net Worth represents a measure of a household's wealth and ability to withstand financial hardship; it is total household assets, such as property and investments, less any secured or unsecured debt, such as credit cards. Median Net Worth divides household net worth into two equal groups in the geographic area; half of the households will have net worth higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HEALTHMEDHINC_CY":{"id":"MEDHINC_CY","fullName":"Health.MEDHINC_CY","alias":"2025 Median Household Income","fieldName":"HEALTHMEDHINC_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHMEDHINC_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $500,000+, it is represented by the value of $500,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2025 Median Home Value","fieldName":"KEYUSFACTSMEDVAL_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY","type":"esriFieldTypeDouble","vintage":"2025","source":"Esri","definition":"Esri 2025 estimate of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more inf
